import React, { Component} from 'react';
import './App.css';

class Contact extends Component {
    render() {
        return (
            <div href="/contact">
                <head>
                    JUDY ZHANG PHOTOGRAPHY
                </head>
                <body>
                    <h1>Contact</h1>
                    <p>Email: zhang.jud@husky.neu.edu</p>
                    <p>Phone number: (201)-665-0678</p>
                </body>
            </div>
        );
    }
}

export default Contact;
